import actionTypes from '../../commons/const/actionTypes';
import _ from 'lodash';

var initialState = {};
var myReducer = (state = initialState, action) => {
  switch (action.type) {

    case actionTypes.setTimeSheet:
      return action.data;
    case actionTypes.SET_COMPENSATION:

    default:
      return state;
  }
}

export default myReducer;
